import React, { Component } from "react";
import Input from "../common/input";
import * as yup from "yup";
import { useForm } from "react-hook-form";
import yupResolver from "@hookform/resolvers";

const schema = yup.object().shape({
  username: yup.string().required("Username required.").min(5),
  password: yup.string().required("Password required.").min(5),
});

class Login extends Component {
  onValidate = () => {
    const result = yup.onValidate(this.state, this.schema);
  };

  onSubmit = (e) => {
    e.preventDefault();
  };

  render() {
    return (
      <div className="Login">
        <div>
          <form onSubmit={this.onSubmit}>
            <Input name="username" label="Username" type="text" required />
            <button>Submit</button>
          </form>
        </div>
      </div>
    );
  }
}

export default Login;
